import React from 'react';

export class Footer extends React.Component {
  render() {
    return (
      <div class="footer">
        <div class="pull-right">
            10GB of <strong>250GB</strong> Free.
        </div>
        <div>
            <strong>Copyright</strong> Example Company &copy; 2014-2015
        </div>
    </div>
    );
  }
}
